	SetupCurrentIndexRankProgressPointList = function ( f2_arg0, f2_arg1, f2_arg2, f2_arg3 )
		LEAGUE_PLAY.SetupCurrentIndexRankProgressPointList( f2_arg0, f2_arg1, f2_arg2, f2_arg3 )
	end,
	ChangeRankProgressIndex = function ( f1_arg0, f1_arg1, f1_arg2 )
		local f1_local0 = DataSources.frontEnd.LP.MyCareerData.CurrentRankIndex:GetValue( f1_arg1 )
		local f1_local1 = LUI.clamp
		local f1_local2 = f1_local0 + f1_arg2
		local f1_local3
		if f1_arg0._isRanked then
			f1_local3 = 1
		else
			f1_local3 = 0
		end
		f1_local1 = f1_local1( f1_local2, f1_local3, #LEAGUE_PLAY.GetRankList() )
		DataSources.frontEnd.LP.MyCareerData.CurrentRankIndex:SetValue( nil, f1_local1 )
		if f1_local1 % 5 == 1 then
			DataSources.frontEnd.LP.MyCareerData.PreviousUnlockRankIndex:SetValue( nil, f1_local1 - 1 )
			DataSources.frontEnd.LP.MyCareerData.NextUnlockRankIndex:SetValue( nil, f1_local1 + 4 )
		elseif f1_local1 % 5 == 4 then
			DataSources.frontEnd.LP.MyCareerData.PreviousUnlockRankIndex:SetValue( nil, f1_local1 - 4 )
			DataSources.frontEnd.LP.MyCareerData.NextUnlockRankIndex:SetValue( nil, f1_local1 + 1 )
		end
	end
}
